import React, { Component } from 'react'

export default class Index extends Component {

  toUrl = (url) => {
    this.props.history.replace(url)
  }

  render() {
    return (
    <div>
      welcome
      <hr/>
      <a onClick={this.toUrl('/testGetData')}>toTestGetData</a>
    </div>
    )
  }

}
